mapper.select:

select 

from CORPAYSUM
where TX_DATE = #{txDate,jdbcType=CHAR}
  and TRIN_ACTNO_ACTUAL = #{trinActnoActual,jdbcType=CHAR}
  and ATMNO = #{atmno,jdbcType=VARCHAR}

mapper.delete:

delete from CORPAYSUM
where TX_DATE = #{txDate,jdbcType=CHAR}
  and TRIN_ACTNO_ACTUAL = #{trinActnoActual,jdbcType=CHAR}
  and ATMNO = #{atmno,jdbcType=VARCHAR}

mapper.update:

update CORPAYSUM
set TOTCNT = #{totcnt,jdbcType=INTEGER},
  TOTAMT = #{totamt,jdbcType=DECIMAL},
  CASHAMT = #{cashamt,jdbcType=DECIMAL},
  COINCNT = #{coincnt,jdbcType=INTEGER},
  COINAMT = #{coinamt,jdbcType=DECIMAL},
  UPDATE_USERID = #{updateUserid,jdbcType=INTEGER},
  UPDATE_TIME = #{updateTime,jdbcType=TIMESTAMP},
  DEPOSITOR = #{depositor,jdbcType=VARCHAR}
where TX_DATE = #{txDate,jdbcType=CHAR}
  and TRIN_ACTNO_ACTUAL = #{trinActnoActual,jdbcType=CHAR}
  and ATMNO = #{atmno,jdbcType=VARCHAR}
